p.tag=[n,u,c],p.category=h,p.author=d,p.description=w,p.markdownHeadings=[],p.excerpt="<p>随着阅读的深入，”选择读什么“的疑惑就越来越明显。对文字、故事、观点、手法等本质没有标准的认知跟理解，好坏的判断全凭感受。</p>\n",p.permalink="/blog/2019/12/good or no good",p.assets={},p.attributes=p,m.type=l,m.internal=t,m.contentType=n,m.slug=y,m.content=t,m.createdAt=new Date(157512528e4),m.updatedAt=new Date(1599186692247),m.title=y,m.layout=l,m.date="2019-11-30 22:48",m.headerImage=!1,m.tag=[n,u,c],m.category=h,m.author=d,m.description=w,m.markdownHeadings=[{text:A,slug:A,level:3},{text:x,slug:x,level:3},{text:"设计过程中什么时候需要CJM？",slug:"设计过程中什么时候需要cjm？",level:3},{text:f,slug:f,level:3},{text:k,slug:k,level:3},{text:b,slug:b,level:3},{text:v,slug:v,level:3},{text:"区域A：用户、场景、目标",slug:"区域a：用户、场景、目标",level:4},{text:"区域B：阶段",slug:"区域b：阶段",level:4},{text:"区域C：任务、思维、情感",slug:"区域c：任务、思维、情感",level:4},{text:"区域D：时机",slug:"区域d：时机",level:4},{text:H,slug:H,level:3},{text:"A final word（尾声）",slug:"a-final-word（尾声）",level:3}],m.excerpt='<p>原文地址：<a href="https://www.invisionapp.com/inside-design/customer-journey-maps/">A beginner’s guide to customer journey maps</a></p>\n',m.permalink="/blog/2019/11/用户体验地图",m.assets={},m.attributes=m,D.type=l,D.internal=t,D.contentType=n,D.slug=L,D.content=t,D.createdAt=new Date(15688512e5),D.updatedAt=new Date(1599186692247),D.layout=l,D.title=L,D.tags=[o],D.markdownHeadings=[],D.excerpt="<p>也许先看汪曾祺再回去读沈从文更能明白《边城》所表达出来的情感，之前先读过《边城》并没有读出来什么惊奇的地方，知识觉得平常，平常事、平常心、平常人。后来看过汪曾祺的《人间草木》，我对花草生物学一无所知，看的很是艰难，看了三分之一就放弃了。直到《山河故人》让我从一个学生的视角，看到了不一样的沈从文。<br>\n故事脱离了背景会变得平平常常，会丧失情绪。就像汪曾祺所言，对当时身边人事与西南大地的热爱与热情，造就了边城、沈从文、汪曾祺等等这些人。<br>\n在山河故人中汪曾祺写道：西南联大的学习生涯里面中，学习古文观止、诗经楚辞、书法，祖父曾教过他写八股文。西南联大在短短时间内教育出了很多享誉世界各领域的人物，谈及原因时，总结道：“因为自由”。</p>\n",D.permalink="/blog/2019/09/山河故人",D.assets={},D.attributes=D,D.tagsInfo=[{name:o,permalink:I}],T.type=l,T.internal=t,T.contentType=n,T.slug="lorem ipsum",T.content=t,T.createdAt=new Date(15615936e5),T.updatedAt=new Date(1599186692247),T.layout=l,T.title="Lorem ipsum",T.tags=[E],T.markdownHeadings=[{text:"起源",slug:"起源",level:3}],T.excerpt="<p>在使用Axure的 “文本段落” 元件时，里面会默认填充一段文字</p>\n",T.permalink="/blog/2019/06/lorem ipsum",T.assets={},T.attributes=T,T.tagsInfo=[{name:E,permalink:"/blog/tag/设计考古"}],B.type=l,B.internal=t,B.contentType=n,B.slug="从魂系列游戏中得出的想法",B.content=t,B.createdAt=new Date(15615936e5),B.updatedAt=new Date(1599186692247),B.layout=l,B.title="从《魂》系列游戏设定所衍生的一点想法",B.tags=[j],B.markdownHeadings=[{text:S,slug:S,level:3},{text:C,slug:C,level:3},{text:M,slug:M,level:3},{text:P,slug:P,level:3}],B.excerpt="<p>在过去近 10 年的时间里，知名游戏开发商 From Software 开发出了魂系列游戏，从《恶魔之魂》、《黑暗之魂》、《血源诅咒》再到如今的《只狼：影逝二度》，我们在其中被各种小怪教做人、被新手村BOSS教做人。我更是曾被古达卡了半年之久。</p>\n",B.permalink="/blog/2019/06/从魂系列游戏中得出的想法",B.assets={},B.attributes=B,B.tagsInfo=[{name:j,permalink:"/blog/tag/游戏设计"}],Q.type=l,Q.internal=t,Q.contentType=n,Q.slug="How to Think Straight  chinaese",Q.content=t,Q.createdAt=new Date(15615072e5),Q.updatedAt=new Date(1599186692247),Q.layout=l,Q.title="How to Think Straight",Q.tags=[i],Q.markdownHeadings=[],Q.excerpt="<p>这个世界上，有两门学科是真正迷人的。一是物理学，它让我们了解我们所处的这个世界。二是心理学，它让我们了解自己。</p>\n",Q.permalink="/blog/2019/06/How to Think Straight  chinaese",Q.assets={},Q.attributes=Q,Q.tagsInfo=[{name:i,permalink:R}],U.type=l,U.internal=t,U.contentType=n,U.slug=F,U.content=t,U.createdAt=new Date(15516576e5),U.updatedAt=new Date(1599186692247),U.layout=l,U.title=F,U.tags=[i],U.markdownHeadings=[{text:q,slug:q,level:3},{text:N,slug:N,level:3},{text:G,slug:G,level:3},{text:_,slug:_,level:3}],U.excerpt="<p>人类经常会有一种倾向，去从事或相信其他多数人从事或相信的东西，就是所谓的“从众效应”。产生从众效应的原因有：\n1、获得集体认可；\n2、获取恰当行为的有关信息（面对未知、我们通常通过观察他人行动而做出决策）；</p>\n",U.permalink="/blog/2019/03/《社会性动物》：从众效应与基础认知",U.assets={},U.attributes=U,U.tagsInfo=[{name:i,permalink:R}],X.type=l,X.internal=t,X.contentType=n,X.slug="we",X.content=t,X.createdAt=new Date(15476832e5),X.updatedAt=new Date(1599186692247),X.layout=l,X.title="我们",X.tags=[s],X.markdownHeadings=[],X.excerpt="<p>我喜欢安晓的勇气，我无法忘记那时候她为我们而做过的决定。</p>\n",X.permalink="/blog/2019/01/we",X.assets={},X.attributes